import React from 'react';
import { PostCard, PostComment, UserImg } from './PostStyle';

const Post: React.FC = () => {
  return (
    <>
      <PostCard>
        <UserImg src="../../assets/img/profile.jpg" />
      </PostCard>
      <PostComment />
    </>
  );
};

export default Post;
